import TextField from "../../common/TextField/withLabel";
import React, {useEffect} from "react";
import {useSelector, useDispatch} from "react-redux";
import {personalInfoSelector} from "./selector";
import {updatePersonalInfo} from "./action";

export default () => {
    const { data } = useSelector(personalInfoSelector);
    const dispatch = useDispatch();
    const [form, setForm] = React.useState(data);
    useEffect(() => {
        dispatch(updatePersonalInfo(form));
    }, [form]);
    const updateFormValue = (target) => {
        setForm({
            ...form,
            [target.name]: target.value
        });
    };

    return (
        <div className="card-body">
            <div className="row">
                <TextField name={'firstName'} label={'First Name*'} placeholder={"First Name"} updateValue={updateFormValue} value={data.firstName}/>
                <TextField name={'lastName'} label={'Last Name*'} placeholder={"Last Name"} updateValue={updateFormValue} value={data.lastName}/>
            </div>
            <div className="row">
                <TextField name={'email'} label={'Email*'} placeholder={"Email"} updateValue={updateFormValue} value={data.email}/>
                <TextField label={'Street address*'} name={'streetAddress'}
                           placeholder={"Street address"} updateValue={updateFormValue} value={data.streetAddress}/>
            </div>
            <div className="row">
                <TextField label={'Zip Code*'} name={'zipcode'} placeholder={"Zip Code"} updateValue={updateFormValue} value={data.zipcode}/>
                <TextField label={'City*'} name={'city'} placeholder={"City"} updateValue={updateFormValue} value={data.city}/>
            </div>
            <div className="row">
                <TextField label={'State*'} name={'stateName'} placeholder={"State"} updateValue={updateFormValue} value={data.stateName}/>
                <TextField label={'Country*'} name={'country'} placeholder={"Country"} updateValue={updateFormValue} value={data.country}/>
            </div>
            <div className="row">
                <TextField label={'Home phone number'} name={'homePhoneNumber'}
                           placeholder={"Home phone number"} updateValue={updateFormValue} value={data.homePhoneNumber}/>
                <TextField label={'Alternate Phone Number'} name={'alternatePhoneNumber'}
                           placeholder={"Alternate Phone Number"} updateValue={updateFormValue} value={data.alternatePhoneNumber}/>
            </div>
        </div>
    )
}
